import React from 'react';

const Atletas = () => {
  const listaExemplo = [
    { id: 1, nome: 'Guga Kuerten', categoria: 'A', ranking: 1 },
    { id: 2, nome: 'Maria Areia', categoria: 'B', ranking: 15 }
  ];

  return (
    <div style={{ padding: '10px' }}>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#eeeeee', textAlign: 'left' }}>
            <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Nome</th>
            <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Categoria</th>
            <th style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>Ranking</th>
          </tr>
        </thead>
        <tbody>
          {listaExemplo.map(atleta => (
            <tr key={atleta.id}>
              <td style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>{atleta.nome}</td>
              <td style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>{atleta.categoria}</td>
              <td style={{ padding: '10px', borderBottom: '1px solid #ddd' }}>{atleta.ranking}ยบ</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Atletas;
